import ListItem from './ListItem';

export default (props) => (
    <div style={{
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'flex-start',
        alignItems: 'center'
    }}>
        {this.props.items.map((item, index) => (
            <ListItem
                key={index.toString()}
                item={item}
                itemNumber={index}
                updateItem={this.props.updateItem}
                deleteItem={this.props.deleteItem} /> 
        ))}
    </div>
);
